import './App.css';
import 'semantic-ui-css/semantic.min.css'
import Home from './homePage/Home';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import AuctionList from '../components/homePage/AuctionList';
import CurrentAuction from '../components/auction/CurrentAuction';
import Cart from '../components/auction/Cart';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path={`/current_auction`}><CurrentAuction /></Route>
          <Route path={`/cart`}><Cart /></Route>
          <Route path={`/`}><AuctionList /></Route>
          <Route path="/" component={Home} />
        </Switch>
      </div>
    </Router>
  );
}
export default App;
